import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'
import { productStore } from '../ProductStore'

const ProductDetail = () => {
  const id = useParams();
  useEffect(()=>{
    const getByIdProduct = async ()=>{
      await productStore.getProduct(id);
    }
    getByIdProduct();
  })
  return (
    <div>
      ProductDetail
   
    </div>
    
    
  )
}
export default ProductDetail
